webpackJsonp([99794875316057],{394:function(A,e){A.exports={data:{site:{meta:{title:"CIID Final Project Kelvyn Marte",description:"CIID Final Project Kelvyn Marte",url:"https://jaxx2104.github.io/gatsby-starter-bootstrap",author:"Kelvyn Ornette Sol Marte",twitter:"kelvynmarte"}},post:{id:"/Users/kelvyn/Projects/2017_08 CIID Final Project/05 Production/Web/ciid-final-project-documentation/src/pages/research/index.md absPath of file >>> MarkdownRemark",html:'<p>I started of my final project with the topic urban wellbeing / health knowing that I would have to narrow it down pretty quickly. During the first two weeks I jumped quickly between convergent and divergent phases in order to test out different assumptions through user or desk research. I might jumped onto things too quickly sometimes, but also I was afraid that I should be already more concrete by now.</p>\n<p>Those two first weeks I tried to wrap my head around a more concrete topic, which I am excited about and which I could executed with the means and time given. Furthermore I arranged several more interviews which I could not conduct, because I could not find a date and time which would have worked for both sides. Particular the second week was packed with events from school.</p>\n<h2>First Expert Interviews</h2>\n<p>\n<em>Torkil how is working as a city planner, involved in citizen participation for the city of Copenhagen</em></p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-bottom: 1.0725rem;; max-width: 750px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 56.25%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Osterbro"\n        title=""\n        src="/ciid-final-project-documentation/static/6625eb8323dcf874a7808663371b00eb-df60d.jpg"\n        srcset="/ciid-final-project-documentation/static/6625eb8323dcf874a7808663371b00eb-45144.jpg 188w,\n/ciid-final-project-documentation/static/6625eb8323dcf874a7808663371b00eb-2f941.jpg 375w,\n/ciid-final-project-documentation/static/6625eb8323dcf874a7808663371b00eb-df60d.jpg 750w,\n/ciid-final-project-documentation/static/6625eb8323dcf874a7808663371b00eb-b1889.jpg 1125w,\n/ciid-final-project-documentation/static/6625eb8323dcf874a7808663371b00eb-1d6f8.jpg 1500w,\n/ciid-final-project-documentation/static/6625eb8323dcf874a7808663371b00eb-a84b6.jpg 2250w,\n/ciid-final-project-documentation/static/6625eb8323dcf874a7808663371b00eb-bbf65.jpg 4480w"\n        sizes="(max-width: 750px) 100vw, 750px"\n      />\n    </span>\n  </span>\n  \n<em>In addition to the interview I also attended an urban planing lecture where Torkil was showing us some concrete examples of neighborhood renewal and climate change resilience projects in the city</em></p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-bottom: 1.0725rem;; max-width: 750px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 71.25890736342043%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Jekaterina"\n        title=""\n        src="/ciid-final-project-documentation/static/71cc339e1f6f70dfaeb1d17e76967c54-df60d.jpg"\n        srcset="/ciid-final-project-documentation/static/71cc339e1f6f70dfaeb1d17e76967c54-45144.jpg 188w,\n/ciid-final-project-documentation/static/71cc339e1f6f70dfaeb1d17e76967c54-2f941.jpg 375w,\n/ciid-final-project-documentation/static/71cc339e1f6f70dfaeb1d17e76967c54-df60d.jpg 750w,\n/ciid-final-project-documentation/static/71cc339e1f6f70dfaeb1d17e76967c54-b1889.jpg 1125w,\n/ciid-final-project-documentation/static/71cc339e1f6f70dfaeb1d17e76967c54-1d6f8.jpg 1500w,\n/ciid-final-project-documentation/static/71cc339e1f6f70dfaeb1d17e76967c54-86e4e.jpg 1684w"\n        sizes="(max-width: 750px) 100vw, 750px"\n      />\n    </span>\n  </span>\n  \n<em>Jekaterina a pedagogue working in a youth centre in Vienna and I talked with her about ownership and mental health of young people in the urban space.</em></p>\n<p>\n  <span\n    class="gatsby-resp-image-wrapper"\n    style="position: relative; display: block; margin-bottom: 1.0725rem;; max-width: 750px; margin-left: auto; margin-right: auto;"\n  >\n    <span\n      class="gatsby-resp-image-background-image"\n      style="padding-bottom: 66.66666666666666%; position: relative; bottom: 0; left: 0; background-image: url(\'data:image/jpeg;base64,\'); background-size: cover; display: block;"\n    >\n      <img\n        class="gatsby-resp-image-image"\n        style="width: 100%; margin: 0; vertical-align: middle; position: absolute; top: 0; left: 0; box-shadow: inset 0px 0px 0px 400px white;"\n        alt="Anja"\n        title=""\n        src="/ciid-final-project-documentation/static/0ecb8b0786c93ad5f9fc5d9dba13f84e-df60d.jpg"\n        srcset="/ciid-final-project-documentation/static/0ecb8b0786c93ad5f9fc5d9dba13f84e-45144.jpg 188w,\n/ciid-final-project-documentation/static/0ecb8b0786c93ad5f9fc5d9dba13f84e-2f941.jpg 375w,\n/ciid-final-project-documentation/static/0ecb8b0786c93ad5f9fc5d9dba13f84e-df60d.jpg 750w,\n/ciid-final-project-documentation/static/0ecb8b0786c93ad5f9fc5d9dba13f84e-b1889.jpg 1125w,\n/ciid-final-project-documentation/static/0ecb8b0786c93ad5f9fc5d9dba13f84e-1d6f8.jpg 1500w,\n/ciid-final-project-documentation/static/0ecb8b0786c93ad5f9fc5d9dba13f84e-a84b6.jpg 2250w,\n/ciid-final-project-documentation/static/0ecb8b0786c93ad5f9fc5d9dba13f84e-77b7f.jpg 5760w"\n        sizes="(max-width: 750px) 100vw, 750px"\n      />\n    </span>\n  </span>\n  \n<em>Anja is a Lead Insight Expert / Cultural Anthropologist at Future Cities Catapult which shared a lot of her insights and techniques for doing research in the city with me.</em></p>\n<p>In addition to a extensive desk research and several discussions among</p>\n<p>I conducted 3 in depth interviews with a social worker, a renewal projects citizen relations manager, an urban research specialist, attended a urban planning lecture as well as the open lecture of Nicolay Boyadjiev and went to a ai meetup at the tech festival.</p>\n<p>Going forward I knew I will have to pick a more concrete spot in Copenhagen and either research more around how people cope with factors which are influencing their mental wellbeing or pick one aspect which is influencing mental wellbeing like social networks in the urban neighborhood, stress, loneliness, segregation …</p>\n<h2>Desk Research</h2>\n<blockquote>\n<p>66% of All Humans Will Live in Cities by 2050</p>\n<footer><cite>—UN, 2014</cite></footer>\n</blockquote>',frontmatter:{layout:"post",title:"Research",path:"/research/",categories:["Typography","TESTS"],date:"2016/03/01"}}},pathContext:{path:"/research/"}}}});
